import { InputText, Password } from "primereact";
import { ButtonPrimary } from "../../../shared/components/buttons/ButtonPrimary";
import { LoginFormHooks } from "./Form.component";
import "./styles.css";
export const FormHtml = () => {
  const { handleSubmit, onSubmit, register, errors } = LoginFormHooks();
  return (
    <div className="container-fluid">
      <div className="items">
        <h1>Login</h1>
      </div>
      <div className="items">
        <form onSubmit={handleSubmit(onSubmit)}>
          <h6>Usuario</h6>
          <span className="p-input-icon-left">
            <i className="pi pi-user" />
            <InputText
              {...register("username", {
                required: "Campo requerido",
                minLength: {
                  value: 5,
                  message: "Debe tener un minimo 5 caracteres",
                },
                maxLength: {
                  value: 20,
                  message: "Debe tener un maximo de 20 caracteres",
                },
              })}
              placeholder="Username"
              autoFocus
              className={errors.username?'input-invalid':'input-valid'}
            />
          </span>
          <div className="space-items error-inputs">
            {errors.username?.message}
          </div>
          <h6>Contrase√±a</h6>
          <Password
            {...register("password", {
              required: "Campo requerido",
              minLength: {
                value: 5,
                message: "Debe tener un minimo 5 caracteres",
              },
              maxLength: {
                value: 20,
                message: "Debe tener un maximo de 20 caracteres",
              },

            })}
            placeholder="Password"
            className={errors.password?'input-invalid':'input-valid'}
            toggleMask
          />
          <div className="space-items error-inputs">
            {errors.password?.message}
          </div>
          <div className="space-items">
            <ButtonPrimary
              type="submit"
              icon="pi pi-check"
              iconsPos="left"
              label="Login"
            />
          </div>
        </form>
      </div>
    </div>
  );
};
